import { DataTable, Table } from '@primer/react/experimental';
import {
  Box,
  Label,
  LabelGroup,
  Link,
  Pagination,
  RelativeTime,
  Heading,
  Text,
  TextInput,
  QueryBuilder,
} from '@primer/react';
import { accessTokens, accessTokens as data } from '../../../data/Data';

export function AccessTokens() {
  return (
    <Box sx={{ width: '100%', mt: 5 }}>
      <Box
        sx={{
          pb: 2,
          mb: 3,
          borderBottom: '1px solid',
          borderColor: 'border.default',
          width: '100%',
        }}
      >
        <QueryBuilder />
        <Heading
          sx={{
            fontSize: 3,
          }}
        >
          Access tokens
        </Heading>
        <Text
          sx={{
            color: 'fg.muted',
            fontSize: 1,
          }}
        >
          View usage by individual token
        </Text>
      </Box>
      <Box>
        <TextInput
          placeholder='Filter tokens'
          sx={{
            width: '100%',
            mb: 3,
          }}
        />
      </Box>
      <Table.Container
        sx={{
          width: '100%',
        }}
      >
        <DataTable
          data={accessTokens}
          columns={[
            {
              header: 'Token',
              field: 'name',
              rowHeader: true,
              renderCell: (row) => (
                <Box
                  sx={{
                    display: 'flex',
                    flexDirection: 'column',
                  }}
                >
                  <Link
                    href='/token-name'
                    sx={{
                      color: 'fg.default',
                      fontSize: 1,
                    }}
                  >
                    <Text>{row.name}</Text>
                  </Link>
                  <Text
                    sx={{
                      color: 'fg.muted',
                      fontWeight: 400,
                    }}
                  >
                    {row.type}
                  </Text>
                </Box>
              ),
            },
            {
              header: 'Total requests',
              field: 'type',
              renderCell: (row) => <Text>{row.totalRequests}</Text>,
            },
            {
              header: 'Last rate limited',
              field: 'updatedAt',
              renderCell: (row) => <Text>{row.lastUsed}</Text>,
            },
          ]}
        />
      </Table.Container>
      <Box>
        <Pagination
          pageCount={4}
          currentPage={1}
          onPageChange={(e) => e.preventDefault()}
          showPages={{
            narrow: false,
          }}
        />
      </Box>
      {/* <Box sx={{ height: '100px' }} /> */}
    </Box>
  );
}
